<div>W 1938 r. z inicjatywy miejscowych nauczycieli otwarto w Przyprostyni Muzeum Ziemi Zbąskiej, gdzie opr&oacute;cz historii regionu prezentowano folklor. Muzeum to zostało zamknięte po zajęciu Wielkopolski przez Niemc&oacute;w.<br />W latach 60 &ndash; tych pod patronatem PTTK powstało w zabytkowej Baszcie Muzeum Regionalne Ziemi Zbąszyńskiej. W roku 2000 zbąszyński oddział PTTKu został rozwiązany a zbiory muzeum zostały przekazane Zbąszyńskiemu Centrum Kultury, kt&oacute;re zorganizowało wystawy czasowe:</div>
<div>- 2000 r. &ndash; Zbąszyń w starych fotografiach,</div>
<div>- 2001 r. &ndash; Kapliczki i krzyże przydrożne,</div>
<div>- 2002 r. &ndash; Pradzieje Ziemi Zbąszyńskiej.</div>
<div>W kwietniu 2004 r. zostało otwarte Muzeum Ziemi Zbąszyńskiej i Regionu Kozła. Mieści się ono w centralnej części miasta, w zabytkowym budynku na Rynku Miejskim.</div>
